import React from "react";
import "./Test.css";
import { useState } from "react";
import logo from "./Asserts/Logos/kiddostardez.png";
import LibraryAddIcon from "@mui/icons-material/LibraryAdd";
import { SvgIcon } from "@mui/material";
import FavoriteBorderIcon from "@mui/icons-material/FavoriteBorder";
import LogoutIcon from "@mui/icons-material/Logout";
import { Box } from "@mui/system";

const Test = () => {
  const [isExpanded, setExpendState] = useState(false);

  return (
    <div
      className={
        isExpanded
          ? "side-nav-container"
          : "side-nav-container side-nav-container-NX"
      }
    >
      <div className="nav-upper">
        <div className="nav-heading">
          {isExpanded && (
            <div className="nav-brand">
              <img
                src={logo}
                alt="Logo"
                style={{
                  height: "70px",
                  width: "120px",
                  margin: "30px",
                }}
              />
            </div>
          )}
          <button
            className={
              isExpanded ? "hamburger hamburger-in" : "hamburger hamburger-out"
            }
            onClick={() => setExpendState(!isExpanded)}
          >
            <span></span>
            <span></span>
            <span></span>
          </button>
        </div>
        <div className="nav-menu">
          <a
            className={isExpanded ? "menu-item" : "menu-item menu-item-NX"}
            href="#"
          >
            <SvgIcon
              component={LibraryAddIcon}
              sx={{ marginRight: "15px" }}
              inheritViewBox
            />

            {isExpanded && <p>Add Product</p>}
          </a>

          <a
            className={isExpanded ? "menu-item" : "menu-item menu-item-NX"}
            href="#"
          >
            <Box
              sx={{
                display: "flex",
                justifyContent: "column",
                backgroundColor: "red",
                width: "150px",
                height: "40px",
                marginLeft: "10px",
              }}
            >
              <SvgIcon
                component={FavoriteBorderIcon}
                inheritViewBox
                sx={{ marginRight: "15px", marginTop: "10px" }}
              />

              {isExpanded && <p style={{ marginTop: "10px" }}>Favoris</p>}
            </Box>
          </a>

          <a
            className={isExpanded ? "menu-item" : "menu-item menu-item-NX"}
            href="#"
          >
            <SvgIcon
              component={LogoutIcon}
              inheritViewBox
              sx={{ marginRight: "15px" }}
            />

            {isExpanded && <p>Log Out</p>}
          </a>
        </div>
      </div>
      <div className="nav-footer">
        {isExpanded && (
          <div className="nav-details">
            <img
              className="nav-footer-avatar"
              src="icons/admin-avatar.svg"
              alt=""
              srcset=""
            />
          </div>
        )}
        <img className="logout-icon" src="icons/logout.svg" alt="" srcset="" />
      </div>
    </div>
  );
};

export default Test;
